import {
    Button,
    Modal,
    ModalBody,
    ModalCloseButton,
    ModalContent,
    ModalFooter,
    ModalHeader,
    ModalOverlay
} from "@chakra-ui/react";
import {TextField} from "../TextField";
import {Formik} from "formik";

export const AddFriendModal = ({isOpen, onClose}) => {
    return (
        <Modal isOpen={isOpen} onClose={onClose}>
            <ModalOverlay/>
            <ModalContent>
                <ModalHeader>
                    Add a friend
                </ModalHeader>
                <ModalCloseButton/>
                <Formik>
                    <ModalBody>
                        <TextField
                            label={"Friend's name"}
                            placeholder={"Enter friend's username"}
                            autoComplete={"off"}
                            name={"friendName"}/>
                    </ModalBody>
                    <ModalFooter>
                        <Button colorScheme={"blue"} onClick={onClose} type={"submit"}>
                            Submit
                        </Button>
                    </ModalFooter>
                </Formik>
            </ModalContent>
        </Modal>
    );
};
